mapper.select:

select 

from HouseholdMarriage
where PersonId = #{personId,jdbcType=VARCHAR}
  and AnnounceDate = #{announceDate,jdbcType=VARCHAR}
  and AnnounceTime = #{announceTime,jdbcType=VARCHAR}
  and Code = #{code,jdbcType=VARCHAR}

mapper.delete:

delete from HouseholdMarriage
where PersonId = #{personId,jdbcType=VARCHAR}
  and AnnounceDate = #{announceDate,jdbcType=VARCHAR}
  and AnnounceTime = #{announceTime,jdbcType=VARCHAR}
  and Code = #{code,jdbcType=VARCHAR}
